import React from 'react'
import { Particles } from "react-particles-js";
import './app.css'
import { black } from 'color-name';

export default function HomeBAW(props) {
    return (
        <div className="homeBAW" id="home">
            <Particles className="test"
            params={{
                "particles": {
                    "number": {
                        "value": 70
                    },
                    "size": {
                        "value": 3
                    },
                    "color": {
                        "value":"#000000"
                    },
                    "line_linked": {
                        "enable": true,
                        "opacity": 1,
                        "color": "#000000"
                    },
                },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": true,
                            "mode": "repulse"
                        }
                    }
                }
            }} />
        </div>
    )
}
